const FindStocks = () => {
  const url = "http://localhost:3000/api/v1/stocks";
  fetch(url, options)
          .then((response) => {
            if (!response.ok) {
              throw new Error("Error: " + response.status);
            }
            return response.json();
          })
          .then((responseJson) => {
            console.log(responseJson);
          })
}

export default FindStocks;
